import React, {Component} from 'react';
import Header from './header';
import Body from './body';
import {headerImg} from './images/postit.jpg';

class Main extends Component{
	constructor(props){
		super(props);
	}
	render(){
		return(
			<div>
				<Header headerImg={headerImg} />
				<Body />
			</div>
		)
	}
};

export default Main;
